package testday1;

public class Primenumbercheck {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int number = 13;
		
		for(int i=2;i<number;i++) {
			int rem =number%i;
			
			if(rem==0);
			{
			 System.out.println("Value is not prime no");

				break;
			}
		}
	}
}
		